// SPDX-License-Identifier: MIT
pragma solidity ^0.7.4;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20Burnable.sol";

contract SwapCifiMetalands {
    using SafeMath for uint256;

    address public immutable cifi;
    address public immutable metalands;
    address public immutable admin;
    uint public immutable ratio = 1000;

    uint256 private unlocked = 1;

    event Swap(address indexed sender, uint256 amount, uint256 ratio);
    event Withdraw(address indexed sender, uint256 amount);

    constructor (address _cifi, address _metalands) {
        cifi = _cifi;
        metalands = _metalands;
        admin = msg.sender;
    }

    modifier lock() { 
        require(unlocked == 1, "SwapCifiMetalands: LOCKED");
        unlocked = 0;
        _;
        unlocked = 1;
    }

    function safeTransfer(address token, address to, uint value) internal {
        // bytes4(keccak256(bytes('transfer(address,uint256)')));
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(0xa9059cbb, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'SwapCifiMetalands: TRANSFER_FAILED');
    }

    function safeTransferFrom(address token, address from, address to, uint value) internal {
        // bytes4(keccak256(bytes('transferFrom(address,address,uint256)')));
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(0x23b872dd, from, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'SwapCifiMetalands: TRANSFER_FROM_FAILED');
    }

    function swap(uint amount) external lock {
        require(amount.mul(ratio) > 0, "SwapCifiMetalands: Invalid amount");
        require(ERC20(metalands).balanceOf(address(this)) >= amount.mul(ratio), "SwapCifiMetalands: Overflow");
        ERC20Burnable(cifi).burnFrom(msg.sender, amount);
        // safeTransferFrom(cifi, msg.sender, admin, amount);
        safeTransfer(metalands, msg.sender, amount.mul(ratio));
        emit Swap(msg.sender, amount, ratio);
    }

    function withdraw(uint amount) external lock {
        require(msg.sender == admin, "SwapCifiMetalands: !admin");
        require(ERC20(metalands).balanceOf(address(this)) >= amount, "SwapCifiMetalands: Withdraw-Overflow");
        safeTransfer(metalands, msg.sender, amount);
        emit Withdraw(msg.sender, amount);
    }
}
